import { createDrawerNavigator } from "react-navigation-drawer";
//import { useWindowDimensions } from 'react-native';
import SignIn from "../components/SignIn";
import SignUp from "../components/SignUp";
import { createAppContainer } from "react-navigation";
import CheckingAuthentication from "../components/CheckingAuthentication";

const Authentication = createDrawerNavigator({
	'Checking Authentication': {
		screen: CheckingAuthentication,
	},
	'Sign In': {
		screen: SignIn,
	},
	'Sign Up': {
		screen: SignUp,
	}
});

/*Authentication.navigationOptions = {
	drawerLabel: "Authentication",
	initialRouteName: 'Sign In',
	drawerType: 'front',
	backBehavior: 'none'
}*/

export default createAppContainer(Authentication);
